import React from "react";

const Osheen = () => {
  return (
    <div>
      <div class="grid grid-rows-12 grid-flow-row gap-x-20  bg-lime-400">
        <div class="row-span-3 bg-black ">01</div>
        <div class="row-span-3 bg-white">01</div>
        <div class="row-span-3 bg-red-700 ">01</div>
      </div>
    </div>
  );
};

export default Osheen;
